完全不同的。 （楼主注：本来想通过这个问题引起新人注意……招聘新人滴，结果潘欣领衔真来回答问题鸟……看起来招PR不适合这种形式） </span><button class=\"Button QuestionRichText-more Button--plain\" type=\"button\">显示全部<svg viewbox=\"0 0 10 6\" class=\"Icon QuestionRichText-more-icon Icon--arrow\" style=\"height:16px;width:10px;\" width=\"10\" height=\"16\" aria-hidden=\"true\"><title></title><g><path d=\"M8.716.217L5.002 4 1.285.218C.99-.072.514-.072.22.218c-.294.29-.294.76 0 1.052l4.25 4.512c.292.29.77.29 1.063 0L9.78 1.27c.293-.29.293-.76 0-1.052-.295-.29-.77-.29-1.063 0z\"></path></g></svg></button></div></div></div>',NULL,NULL,22,7,1498,180781,'2017-05-04 10:21:27',NULL),(19718003,'家居','https://www.zhihu.com/question/19718003','自己设计房子的装修和布置，有哪些原则和细节需要注意？','<div class=\"QuestionHeader-detail\"><div class=\"QuestionRichText QuestionRichText--expandable QuestionRichText--collapsed\"><div><span class=\"RichText\">希望大家分享一下自己的经验。 </span><button class=\"Button QuestionRichText-more Button--plain\" type=\"button\">显示全部<svg viewbox=\"0 0 10 6\" class=\"Icon QuestionRichText-more-icon Icon--arrow\" style=\"height:16px;width:10px;\" width=\"10\" height=\"16\" aria-hidden=\"true\"><title></title><g><path d=\"M8.716.217L5.002 4 1.285.218C.99-.072.514-.072.22.218c-.294.29-.294.76 0 1.052l4.25 4.512c.292.29.77.29 1.063 0L9.78 1.27c.293-.29.293-.76 0-1.052-.295-.29-.77-.29-1.063 0z\"></path></g></svg></button></div></div></div>',NULL,NULL,74,5,21143,1163820,'2017-05-03 22:45:06',NULL),(19848752,'结婚,婚姻,相亲,爱情,异性交往','https://www.zhihu.com/question/19848752','你怎么看待相亲？','<div class=\"QuestionHeader-detail\"><div class=\"QuestionRichText QuestionRichText--expandable QuestionRichText--collapsed\"><div><span></span><button class=\"Button QuestionRichText-more Button--plain\" type=\"button\">显示全部<svg viewbox=\"0 0 10 6\" class=\"Icon QuestionRichText-more-icon Icon--arrow\" style=\"height:16px;width:10px;\" width=\"10\" height=\"16\" aria-hidden=\"true\"><title></title><g><path d=\"M8.716.217L5.002 4 1.285.218C.99-.072.514-.072.22.218c-.294.29-.294.7