940247','中国工商银行根据什么规定把没钱的排队放到最后？','<div class=\"QuestionHeader-detail\"><div class=\"QuestionRichText QuestionRichText--expandable QuestionRichText--collapsed\"><div><span class=\"RichText\">今天早晨九点工商银行开门时就排上号了，是A30，到了中午两点都没办成。原因是上午九点从办业务开始就一直给B01.E01什么的办业务，直到十二点都没给A01办业务。十二点以后才轮到A01，期间只要有B,C,DE什么的就停止给A办业务。我就纳闷了，难道我们穷人的时间就这么不值钱了？</span><button class=\"Button QuestionRichText-more Button--plain\" type=\"button\">显示全部<svg viewbox=\"0 0 10 6\" class=\"Icon QuestionRichText-more-icon Icon--arrow\" style=\"height:16px;width:10px;\" width=\"10\" height=\"16\" aria-hidden=\"true\"><title></title><g><path d=\"M8.716.217L5.002 4 1.285.218C.99-.072.514-.072.22.218c-.294.29-.294.76 0 1.052l4.25 4.512c.292.29.77.29 1.063 0L9.78 1.27c.293-.29.293-.76 0-1.052-.295-.29-.77-.29-1.063 0z\"></path></g></svg></button></div></div></div>',NULL,NULL,124,25,723,181120,'2017-05-03 23:04:53',NULL),(30158223,'美国,民主党（美国）,美国政治人物,2016 年美国大选,伯尼·桑德斯（Bernie Sanders）','https://www.zhihu.com/question/30158223','如何评价伯尼·桑德斯 (Bernie Sanders)？','<div class=\"QuestionHeader-detail\"><div class=\"QuestionRichText QuestionRichText--expandable QuestionRichText--collapsed\"><div><span class=\"RichText\">如何评价他的政治主张和他2016年竞选美国总统的决定？ 伯纳德·“伯尼”·桑德斯，美国联邦参议员，代表佛蒙特州，2013–2015年参议院退伍军人委员会主席、2015年参议院财政预算委员会在野党派领袖。他是美国国会史上任期最长的无党派独立议员。 桑德斯自认民主社会主义者，乔姆斯基认为他“简而言之，是罗斯福新政主义者”。<a class=\" wrap external\" href=\"https://link.zhihu.com/?target=http%3A//zh.wikipedia.org/zh-cn/%25E4%25BC%25AF%25E5%25B0%25BC%25C2%25B7%25E6%25A1%2591%25E5%25BE%25B7%25E6%2596%25AF\" target=\"_blank\" rel=\"nofollow noreferrer\">维基百科<i class=\"icon-external\"></i></a></span><button class=\"Button QuestionRichText-more Button--plain\" type=\"button\">显示全部<svg viewbox=\"0 0 10 6\" class=\"Icon QuestionRichText-more-icon Icon--arrow\" style=\"height:16px;width:10px;\" width=\"10\" height=\"16\" aria-hidden=\"true\"><title></title><g><path d=\"M8.716.217L5.002 4 1.285.218C.99-.072.514-.072.22.218c-.294.29-.294.76 0 1.052l4.25 4.512c.292.29.77.29 1.063 0L